import React, {Component} from 'react';
import './App.css';

class App extends Component {
  state = {
      users: [],
      monthes: []
  }

  componentDidMount() {
      const url = 'https://yalantis-react-school.herokuapp.com/api/task0/users'

      fetch(url)
        .then(result => result.json())
        .then(result => {
          this.setState({
            users: result,
          })
        })
    }

  render() {
      return(
          <table>
              <tr>
                  <th>ID</th>
                  <th>firstName</th>
                  <th>lastName</th>
                  <th>dob</th>
              </tr>
              { 
              this.state.users.map( user => {
                  return(
                      <User user={user}/>
                  )})}
          </table>
      ) 
  }
}

export default App;
